import React, { Component } from "react";
import fire from "../config/Fire";



 class Home extends Component {
  constructor(props) {
    super(props);
    this.logout = this.logout.bind(this);
  }

  logout() {
    fire.auth().signOut();
  }

  render() {
    return (
      <div id="container">
        <h3>Search your event</h3>
        <div className="form-group">
          <input
            type="search"
            name="search"
            className="form-control"
            id="exampleInputEmail1"
            placeholder="Search..."
          />
          <button onClick={this.logout} className="btn btn-danger" id="out">
            Log Out
          </button>
        </div>
       
      </div>
    );
  }
}

export default Home;
